//Dependencias
import React, { Component } from 'react';

//Componentes
import './styles.css';

class Footer extends Component{

    render() {
        return(
        <footer className="footer-bar">
            @NotThatEasyTaxy 2019
        </footer>
        );
    }
}

export default Footer;
